import React from "react";
import ReactDOM from 'react-dom';
import WordLimit from 'react-word-limit';


// reactstrap components
import {
  Card,
  CardHeader,
  CardBody,
  NavItem,
  NavLink,
  Nav,
  TabContent,
  TabPane,
  Container,
  Row,
  Col,

  Button,
  Input,
  InputGroupAddon,
  InputGroupText,
  InputGroup,

  Pagination,
  PaginationItem,
  PaginationLink,

} from "reactstrap";

// core components

const par = {margintop: "0px", marginbottom: "1rem", height: "215px", overflow: "hidden"};


function Tabs() {
  const [iconPills, setIconPills] = React.useState("1");
  const [pills, setPills] = React.useState("1");
  return (
    <>
      <div className="section section-tabs"
      id="baca-section">
        <Container>
          <Row className="ml-auto mr-auto" md="10" xl="25">
              <p className="category">Carita.</p>
              <Card>
                <CardHeader>
                  <Nav className="justify-content-center">
                    <NavItem>
                      <NavLink
                        className={iconPills === "1" ? "active" : ""}
                        href="#pablo"
                        onClick={(e) => {
                          e.preventDefault();
                          setIconPills("1");
                        }}
                      >
                       <h1 className="category">Hahahahahahahahaha</h1> 
                      </NavLink>
                    </NavItem>
                  </Nav>
                </CardHeader>
                <CardBody>
                  <TabContent
                    className="text-justify"
                    activeTab={"iconPills" + iconPills}
                  >
                    <TabPane  style={par} tabId="iconPills1">
                      <p>
                        <WordLimit limit={3}>I think ass as</WordLimit>
                      </p>
                    </TabPane>
                  </TabContent>
                </CardBody>
              </Card>
            </Row>
        </Container>
      </div>

    </>
  );
}

export default Tabs;
